let imgdiv= document.querySelector("#imgshowing")

function sortbyprice(){
    let value=document.querySelector("#Sprice").value
    if(value=="HtL"){
    womensData.sort(function(a,b){
      return b.price-a.price;
    })
    display(womensData);
    }
    else{
      womensData.sort(function(a,b){
        return a.price-b.price;
      })
      display(womensData)
    }
  }
  
  display(womensData);
  function display(res){
    imgdiv.innerHTML=null;
   res.forEach(function(el){
    let cart=document.createElement("div")

    let img=document.createElement("img")
    img.src=el.image_url;

    let name=document.createElement("p");
    name.innerText=el.name;

    let or_price=document.createElement("s");
    or_price.innerText="Price: "+el.strikedoffprice;
    
    let price=document.createElement("p");
    price.innerText="Price: "+el.price;

    let button=document.createElement("button");
    button.innerHTML="Add cart";
    button.addEventListener("click",function(){
        mybutton(el);
    })

    cart.append(img,name,or_price,price,button);
    imgdiv.append(cart);
   })
   let mensarr=JSON.parse(localStorage.getItem("addcart")) || [];
   function mybutton(el){
    mensarr.push(el)
    localStorage.setItem("addcart",JSON.stringify(mensarr));
    window.location.reload();
   }
   
}